import React from 'react';
import { Button } from 'react-bootstrap';
import { useHistory } from 'react-router-dom';
import '../assets/css/';
const dummyData = [
  {
    id: '1',
    facility: '1',
    visitor: '2020.05.14',
    Sortation: '이미지',
    phone: '010-****-***9',
    date: '2020.05.14',
    Validity: '30분',
    Approval: '승인',
  },
  {
    id: '2',
    facility: '99',
    visitor: '2020.05.14',
    Sortation: '이미지',
    phone: '010-****-***1',
    date: '2020.08.14',
    Validity: '35분',
    Approval: '거절',
  },
  {
    id: '3',
    facility: '80',
    visitor: '2020.05.14',
    Sortation: '이미지',
    phone: '010-****-***3',
    date: '2020.07.14',
    Validity: '30분',
    Approval: '승인',
  },
];
const BennerMastr = () => {
  const history = useHistory();
  return (
    <>
      <div className="bennerContent">
        <div className="benner">배너관리</div>
        <div className="benner">
          <button
            className="benner-btn"
            onClick={() => {
              history.push('/banneradd');
            }}
          >
            배너등록
          </button>
        </div>
      </div>
      <div className="talbe-box">
        <div className="benner-list">
          <table>
            <thead>
              <tr className="tr_heder">
                <th>#</th>
                <th>노출순위</th>
                <th>일시</th>
                <th>대표이미지 </th>
                <th></th>
              </tr>
            </thead>
            <tbody>
              {dummyData.map((d) => (
                <tr key={d.id}>
                  <td>{d.id}</td>
                  <td>{d.facility}</td>
                  <td>{d.visitor}</td>
                  <td>{d.Sortation}</td>
                  <td>
                    {' '}
                    <button className="cancel-btn">취소</button>
                    &nbsp; &nbsp;
                    <button className="edit-button">수정</button>{' '}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </>
  );
};

export default BennerMastr;
